import React, {useState, useEffect} from 'react'

export default function App() {

    const [movieList, setMovieList] = useState([]);

    useEffect(() => {
        async function fetchData() {
            let list = await Tmdb.getHomeList();
            console.log(list);
            setMovieList(list);
        }
        fetchData();
    }, []);

    return (
    <div>

        {movieList.map(movie => movie.slug)}
    </div>
    )
}
